import {
  makeStyles,
  TextField,
  Button,
  Paper,
  Tabs,
  Tab,
  Box,
  Typography,
  Card,
  CardActionArea,
  CardMedia,
  CardContent,
  CardActions,
  IconButton,
} from "@material-ui/core";
import {
  FiZap as OutputIcon,
  FiClock as HistoryIcon,
  FiClipboard as ClipboardIcon,
  FiStar as FavouriteIcon,
  FiFlag as FlagIcon,
  FiTrash as DeleteIcon,
} from "react-icons/fi";
import PropTypes from "prop-types";
import { FiCheckSquare } from "react-icons/fi";
import { useState } from "react";
import AppTemplate from "./AppTemplate";
import PageHead from "./PageHead";
import PageFoot from "./PageFoot";
import { MdFavorite } from "react-icons/md";

const useStyles = makeStyles((theme) => ({
  container: {
    display: "flex",
    borderBottom: `1px solid ${theme.palette.grey.main}`,
    [theme.breakpoints.down("sm")]: {
      flexDirection: "column",
    },
  },
  root: {
    maxWidth: "350px",
    boxShadow: "none",
    border: "1px solid #eee",
  },
  media: {
    height: 250,
    width: 250,
  },
  inputForm: {
    width: "100%",
    borderRight: `1px solid ${theme.palette.grey.main}`,
    minHeight: "500px",
    padding: theme.spacing(5),
    paddingTop: theme.spacing(5),
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-evenly",
    alignItems: "flex-start",

    [theme.breakpoints.down("sm")]: {
      padding: theme.spacing(3),
      borderBottom: `1px solid ${theme.palette.grey.main}`,
      borderRight: `none`,
      width: "100%",
    },
  },
  textFeild: {
    backgroundColor: "#fff",
    maxWidth: "500px",
  },
  formItem: {
    marginBottom: theme.spacing(3),
  },
  btnMain: {
    backgroundImage: "linear-gradient(93.12deg, #0067B1 1.28%, #008080 99.48%)",
    color: theme.palette.light.main,
    paddingTop: theme.spacing(1),
    paddingBottom: theme.spacing(1),
    paddingLeft: theme.spacing(2),
    paddingRight: theme.spacing(2),
  },
  outputContainer: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "flex-start",
    alignItems: "stretch",

    [theme.breakpoints.down("sm")]: {
      width: "100%",
    },
  },
  imagesCards: {
    marginTop: theme.spacing(4),
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-evenly",
    alignItems: "start",

    [theme.breakpoints.down("sm")]: {
      flexDirection: "column",
    },
  },
  cardsContainer: {
    // overflowY: "scroll",
    paddingRight: theme.spacing(0.7),
    paddingLeft: theme.spacing(0.7),
  },
  tabCard: {
    width: "100%",
    backgroundColor: "#F3F8FA",
    boxShadow: "none",
    borderBottom: `1px solid ${theme.palette.grey.main}`,
  },
  TabIconContent: {
    display: "flex",
    alignItems: "center",
  },
  ml1: {
    marginLeft: theme.spacing(1),
  },
  tabIcon: {
    fontSize: "16px",
  },
  outputCard: {
    padding: theme.spacing(1),
    paddingLeft: theme.spacing(2),
    paddingRight: theme.spacing(2),
    boxShadow: "none",
    border: `1px solid ${theme.palette.grey.dark}`,
  },
  cardTime: {
    color: theme.palette.grey.dark,
  },
  cardResult: {
    fontWeight: "bold",
    color: theme.palette.dark.main,
    fontSize: "18px",
  },
  btnsContainer: {
    display: "flex",
    justifyContent: "space-between",
  },
  cardBtn: {
    borderRadius: theme.shape.borderRadius,
    transform: "scale(0.8)",
    backgroundColor: theme.palette.grey.main,
    padding: theme.spacing(0.7),
  },
  historyText: {
    color: theme.palette.dark.main,
    fontSize: "18px",
    fontWeight: "bold",
  },

  keywordList: {
    paddingLeft: theme.spacing(2),
    paddingBottom: theme.spacing(1.1),
  },
  keywordListItem: {
    paddingTop: theme.spacing(1),
    color: theme.palette.dark.main,
  },
}));

// Nav Tabs
function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography component={"span"}>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function ImageCrawler() {
  const classes = useStyles();

  const [keywords, setKeywords] = useState("");
  const [description, setDescription] = useState("");

  //   Tabs Methods
  const [value, setValue] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div>
      <PageHead title={"Image Crawler"} />
      <div className={classes.container}>
        <div className={classes.inputForm}>
          <div style={{ display: "flex", alignItems: "center", width: "100%" }}>
            <form
              noValidate
              onSubmit={handleSubmit1((data) => {
                updateComplaint(data);
              })}
            >
              <TextField
                variant={"outlined"}
                multiline
                fullWidth
                rows={8}
                InputLabelProps={{ shrink: true }}
                {...register1("complaint", {
                  required: "Complaint Detail Required",
                  pattern: {
                    value: /^[a-zA-Z0-9_. -]{2,}$/m,
                    message: "Invalid Complaint Detail",
                  },
                })}
                error={Boolean(errors1.complaint)}
                helperText={errors1.complaint?.message}
              />
              <div className={classes.dFlexBetween}>
                <Button
                  className={classes.submitBtn}
                  variant={"contained"}
                  type="submit"
                  disableElevation
                  disabled={actionDisable}
                  color={"primary"}
                >
                  Edit Complaint
                  {actionDisable ? <Progress color="primary" size={20} /> : ""}
                </Button>
                <Button
                  className={classes.btn}
                  variant="contained"
                  disableElevation
                  onClick={editClose}
                >
                  Cancel
                </Button>
              </div>
            </form>
            <TextField
              label={"Keyword"}
              variant={"outlined"}
              fullWidth
              className={[classes.textFeild].join(" ")}
              value={keywords}
              style={{ borderTopRightRadius: 0, borderBottomRightRadius: 0 }}
              onChange={(e) => setKeywords(e.target.value)}
            />
            <Button
              color="primary"
              variant="contained"
              disableElevation
              style={{
                marginLeft: "10px",
                margin: "10px",
                paddingTop: "15px",
                paddingBottom: "15px",
                paddingLeft: "30px",
                paddingRight: "30px",
              }}
            >
              Search
            </Button>
          </div>
          <div className={classes.imagesCards}>
            <Card className={classes.root} disableElevation outlined>
              <CardActionArea>
                <CardMedia
                  className={classes.media}
                  image="https://images.unsplash.com/photo-1636916771246-f2a1f2d9fd4b?ixlib=rb-1.2.1&raw_url=true&q=60&fm=jpg&crop=entropy&cs=tinysrgb&ixid=MnwxMjA3fDB8MHx0b3BpYy1mZWVkfDF8YU5jYVMwTWlkREl8fGVufDB8fHx8&auto=format&fit=crop&w=800"
                  title="Contemplative Reptile"
                />
              </CardActionArea>
              <CardActions
                style={{ display: "flex", justifyContent: "space-between" }}
              >
                <a
                  href="https://webflow.com/templates/category/technology-websites"
                  style={{ textDecoration: "none" }}
                  target="_blank"
                >
                  <Button size="small" color="primary" variant="contained">
                    Download
                  </Button>
                </a>

                <IconButton size="large">
                  <MdFavorite />
                </IconButton>
              </CardActions>
            </Card>
          </div>
        </div>
      </div>
      <PageFoot
        nextLink="/aiBLog"
        backLink="/blogOutline"
        pageNo="2"
        backDisabled={true}
      />
    </div>
  );
}
export default ImageCrawler;
